description:
&lt;p&gt;
Après plus de 10 ans d&apos;existence il serait bien temps de revenir un peu sur les perles que nous a lâché &lt;a href=&quot;http://prootrecords.com/&quot;&gt;Proot records&lt;/a&gt; depuis ses débuts ! Et quoi de mieux qu&apos;une compilation/mix pour parcourir cette histoire ?&lt;/p&gt;
&lt;p&gt;
Mr. Thiaz Itch, principal patron du label, s&apos;est attelé à cette tâche pour nous concoyocter cette sélection non dans le but de présenter un &lt;em&gt;best of Proot&lt;/em&gt; mais bien dans l&apos;idée de nous mixer une histoire, qui soit assez variée pour nous exposer leur palette de productions.
&lt;/p&gt;
&lt;p&gt;
Vous souhaitant une excellente écoute, nous vous invitons à aller visiter &lt;a href=&quot;http://prootrecords.com/&quot;&gt;prootrecords.com&lt;/a&gt; pour en découvrir encore plus ! (tous les albums écoutables en entier, et quelques-uns dont le téléchargement est payant).
&lt;/p&gt;

